xt":"&amp;lt;h3&amp;gt;This interactive map shows 1,284 &amp;lt;em&amp;gt;Holocene&amp;lt;/em&amp;gt; volcanoes and their associated attributes. &amp;lt;sup class=&amp;quot;footnote-ref&amp;quot;&amp;gt;&amp;lt;a href=&amp;quot;#fn1&amp;quot; id=&amp;quot;fnref1&amp;quot;&amp;gt;[1]&amp;lt;/a&amp;gt;&amp;lt;/sup&amp;gt;&amp;lt;/h3&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;\n&amp;lt;p&amp;gt;The heatmap shows the intensity and concentration of the volcanoes &amp;lt;em&amp;gt;composite index score&amp;lt;/em&amp;gt;, which is calculated based on several attributes, including the average VEI, max VEI, population radius within 5-100km, and total number of fatalities from each volcano.&amp;lt;/p&amp;gt;\n&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;\n&amp;lt;p&amp;gt;Volcanoes that resulted with a &amp;lt;em&amp;gt;composite index score&amp;lt;/em&amp;gt; are marked as &amp;lt;em&amp;gt;Notewothy Volcanoes.&amp;lt;/em&amp;gt; (100 total)&amp;lt;/p&amp;gt;\n&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n&amp;lt;h3&amp;gt;The interactive 3D Hexagon map shows the number of eruptions per volcanic area within the last 12,000 years.&amp;lt;/h3&amp;gt;\n&amp;lt;br&amp;gt;\n&amp;lt;hr /&amp;gt;\n&amp;lt;h3&amp;gt;Sources&amp;lt;/h3&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;\n&amp;lt;p&amp;gt;Global Volcanism Program, 2024. [Database] Volcanoes of the World (v. 5.1.7; 26 Apr 2024) - Distributed by Smithsonian Institution, compiled by Venzke, E. &amp;lt;em&amp;gt;&amp;lt;a href=&amp;quot;https://doi.org/10.5479/si.GVP.VOTW5-2023.5.1&amp;quot;&amp;gt;https://doi.org/10.5479/si.GVP.VOTW5-2023.5.1&amp;lt;/a&amp;gt;&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;\n&amp;lt;p&amp;gt;National Geophysical Data Center / World Data Service (NGDC/WDS): NCEI/WDS Global Significant Volcanic Eruptions Database - NOAA National Centers for Environmental Information &amp;lt;em&amp;gt;&amp;lt;a href=&amp;quot;https://doi.org/10.7289/V5JW8BSH&amp;quot;&amp;gt;https://doi.org/10.7289/V5JW8BSH&amp;lt;/a&amp;gt;&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;\n&amp;lt;p&amp;gt;Global Volcanism Program, Smithsonian Institution &amp;lt;em&amp;gt;&amp;lt;a href=&amp;quot;https://volcano.si.edu/database/search_eruption_results.cfm&amp;quot;&amp;gt;https://volcano.si.edu/database/search_eruption_results.cfm&amp;lt;/a&amp;gt;&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n&amp;lt;p&amp;gt;&amp;lt;em&amp;gt;Interactive maps created using Plotly, DeckGL and integrated with Panel&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;For more information on both maps, please refer to my GitHub repository &amp;lt;em&amp;gt;&amp;lt;a href=&amp;quot;https://github.com/Matteo2979/Volcano-Analysis&amp;quot;&amp;gt;https://github.com/Matteo2979/Volcano-Analysis&amp;lt;/a&amp;gt;&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;For information on the data used for this map, please refer to my dataset on Kaggle &amp;lt;em&amp;gt;&amp;lt;a href=&amp;quot;https://www.kaggle.com/datasets/matteochilelli/volcano-dataset/data&amp;quot;&amp;gt;https://www.kaggle.com/datasets/matteochilelli/volcano-dataset/data&amp;lt;/a&amp;gt;&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;br&amp;gt;\n&amp;lt;p&amp;gt;&amp;lt;em&amp;gt;&amp;lt;strong&amp;gt;Created by Matteo Chilelli&amp;lt;/strong&amp;gt;&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;br&amp;gt;\n&amp;lt;hr class=&amp;quot;footnotes-sep&amp;quot; /&amp;gt;\n&amp;lt;section class=&amp;quot;footnotes&amp;quot;&amp;gt;\n&amp;lt;ol class=&amp;quot;footnotes-list&amp;quot;&amp;gt;\n&amp;lt;li id=&amp;quot;fn1&amp;quot; class=&amp;quot;footnote-item&amp;quot;&amp;gt;&amp;lt;p&amp;gt;Volcanoes with eruptions during the &amp;lt;em&amp;gt;Holocene&amp;lt;/em&amp;gt; period (approximately the last 12,000 years). &amp;lt;a href=&amp;quot;#fnref1&amp;quot; class=&amp;quot;footnote-backref&amp;quot;&amp;gt;\u21a9\ufe0e&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt
